import { DndProvider, useDrag, useDrop } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';
import { useState } from 'react';
import './Board.css';
import Hexagon from './Hexagon';
import Champion from './Champion';

function Board() {
  const [positions, setPositions] = useState({
    ashe: {x: 350, y: 250}, // default bottom right
    garen: {x: 50, y: 50} // default top left  
  });

  const handleDragStart = (id) => {
    // Save initial position
  }

  const handleDragEnd = (id, dropResult) => {

    if (dropResult) {
      // Update positions state
      setPositions((prevPositions) => ({
        ...prevPositions,
        [id]: { x: dropResult.x, y: dropResult.y },
      }));
    }

  }

  const [, asheRef] = useDrag({
    type: 'CHAMPION',
    item: { id: 'ashe' },
    begin: () => handleDragStart('ashe'),
    end: (_, monitor) => handleDragEnd('ashe', monitor.getDropResult()),
  });

  const [, hexagonRef] = useDrop({
    accept: 'CHAMPION',
    drop: (item, monitor) => {
      const { x, y } = monitor.getClientOffset();
      const hexagonType = monitor.getItemType() === 'enemy' ? 'enemy' : 'user';
      return { x, y, hexagonType };
    },
  });

  return (
    <DndProvider backend={HTML5Backend}>
      <Champion
        position={positions.ashe}
        onDragStart={asheRef}
        onDragEnd={(dropResult) => handleDragEnd('ashe', dropResult)}
      />
      <Champion
        position={positions.garen}
      />
      <div ref={hexagonRef}>
        <div className="hex-row">
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
        </div>
        <div className="hex-row even">
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
        </div>
        <div className="hex-row">
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
        </div>
        <div className="hex-row even">
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
          <Hexagon player="enemy"/>
        </div>
        <div className="hex-row">
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
        </div>
        <div className="hex-row even">
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
        </div>
        <div className="hex-row">
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
        </div>
        <div className="hex-row even">
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
          <Hexagon player="user"/>
        </div>
      </div>
    </DndProvider>
  );
}

export default Board;
